import React, {useEffect} from "react";
import "./MainContent.scss"
import First from "../First/First"
import Second from "../Second/Second"
import Game from "../../Game/Game"
import { BlockTypes } from './../../Game/Types';  // Import BlockTypes from the correct path

interface MainContentProps{
}
export const MainContnent: React.FC<MainContentProps> = props => {

    const blocks = [
        { id: 1, text: 'Block 1', type: BlockTypes.TEXT, isAnimating: true },
        { id: 2, text: 'Block 2', type: BlockTypes.IMAGE, isAnimating: false },
        // ... other blocks
    ];

    return (
        <div className={"Main"}>
            <Game blocks={blocks}></Game>
            <First></First>
            <Second></Second>
        </div>
    );
}

export default MainContnent;
